import React from "react";
import { Nav } from "react-bootstrap";

const activeStyle = {
  color: "rgb(187, 46, 31)",
};

function LittleNav() {
  return (
    <Nav className="justify-content-center" activeKey="/">
      <Nav.Item>
        <NavLink activeStyle={activeStyle} to="/" exact></NavLink>
      </Nav.Item>
      <Nav.Item>
        <Nav.Link onSelect={activeStyle} href="/movements">
          Movements
        </Nav.Link>
      </Nav.Item>
    </Nav>
  );
}

export default LittleNav;
